import React from 'react';
import { motion } from 'framer-motion';
import { CheckCircle, ArrowRight } from 'lucide-react';

const WhatWeOffer = () => {
  const features = [
    {
      title: "Google Maps Domination",
      description: "Secure top 3 positions in Google Maps for your primary keywords. Our proven strategies get you found when customers search locally.",
      icon: "üó∫Ô∏è"
    },
    {
      title: "Local Citation Building",
      description: "Build consistent NAP citations across 100+ directories. Improve your local search rankings and online visibility.",
      icon: "üìû"
    },
    {
      title: "Review Management",
      description: "Generate authentic 5-star reviews and manage your online reputation. Turn happy customers into your best marketing.",
      icon: "‚≠ê"
    },
    {
      title: "Performance Reporting",
      description: "Monthly reports showing your rankings, traffic, and lead generation. Track your ROI with transparent metrics.",
      icon: "üìä"
    }
  ];

  const fadeInUp = {
    initial: { opacity: 0, y: 30 },
    whileInView: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <section id="what-we-offer" className="relative py-20 bg-gradient-to-b from-[#0f0f1a] to-[#09090f] overflow-hidden">
      {/* Space background effects */}
      <div className="absolute inset-0">
        <div className="absolute top-20 left-10 w-1 h-1 bg-[#3abef9]/40 rounded-full blur-[1px]" />
        <div className="absolute top-40 right-20 w-0.5 h-0.5 bg-white/30 rounded-full blur-[0.8px]" />
        <div className="absolute bottom-40 left-1/4 w-1.5 h-1.5 bg-[#00ffff]/50 rounded-full blur-[1.2px]" />
        <div className="absolute bottom-20 right-1/3 w-0.8 h-0.8 bg-[#3abef9]/35 rounded-full blur-[1px]" />
      </div>

      <div className="container mx-auto px-4 relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-6 bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent">
            What We Offer
          </h2>
          <p className="text-xl text-[#9ca3af] max-w-3xl mx-auto">
            Comprehensive local SEO services designed to dominate your market and drive real business results.
          </p>
        </motion.div>

        <div className="grid md:grid-cols-2 gap-8 mb-16">
          {features.map((feature, index) => (
            <motion.div
              key={index}
              {...fadeInUp}
              transition={{ delay: index * 0.1 }}
              className="bg-gradient-to-br from-[#10111a] to-[#0a0a0f] p-8 rounded-2xl border border-[#3abef9]/20 hover:border-[#3abef9]/40 transition-all duration-300 hover:shadow-[0_0_32px_0_rgba(58,190,249,0.15)]"
            >
              <div className="flex items-start space-x-4">
                <div className="text-3xl">{feature.icon}</div>
                <div>
                  <h3 className="text-xl font-semibold text-white mb-3">
                    {feature.title}
                  </h3>
                  <p className="text-[#9ca3af] leading-relaxed">
                    {feature.description}
                  </p>
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Client-First Flexibility Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          className="bg-gradient-to-r from-[#3abef9]/10 to-[#007bff]/10 p-8 rounded-2xl border border-[#3abef9]/30"
        >
          <div className="text-center">
            <h3 className="text-2xl font-bold text-white mb-4">
              No Contracts. Cancel Anytime.
            </h3>
            <p className="text-[#9ca3af] mb-6 max-w-2xl mx-auto">
              We're confident in our results. That's why we don't lock you into long-term contracts. 
              Start seeing results in 30 days or cancel anytime.
            </p>
            <div className="flex flex-wrap justify-center gap-4 text-sm text-[#9ca3af]">
              <div className="flex items-center space-x-2">
                <CheckCircle className="w-4 h-4 text-[#3abef9]" />
                <span>30-day results guarantee</span>
              </div>
              <div className="flex items-center space-x-2">
                <CheckCircle className="w-4 h-4 text-[#3abef9]" />
                <span>No setup fees</span>
              </div>
              <div className="flex items-center space-x-2">
                <CheckCircle className="w-4 h-4 text-[#3abef9]" />
                <span>Cancel anytime</span>
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default WhatWeOffer;
